                        onStart={handleStart} 
                        onStop={handleStop}
                        grid={[25, 25]}>
                            <div className="handle1" style={{position: 'relative',
                            background: `url(${url7})`,
                            backgroundSize: 'contain',
                            backgroundRepeat: 'no-repeat'}}></div>
                        </Draggable>
                    {/* </div>

                </div> */}

                {/* <div className="pic-line"> */}
                    {/* 2nd line, 2 - 5 - 8 */}
                    {/* <div className="single-pic"> */}
                        <Draggable 
                        onStart={handleStart} 
                        onStop={handleStop}
                        grid={[25, 25]}>
                            <div className="handle1" style={{position: 'relative',
                            background: `url(${url2})`,
                            backgroundSize: 'contain',
                            backgroundRepeat: 'no-repeat'}}></div>
                        </Draggable>
                    {/* </div>

                    <div className="single-pic"> */}
                        <Draggable 
                        onStart={handleStart} 
                        onStop={handleStop}
                        grid={[25, 25]}>
                            <div className="handle1" style={{position: 'relative',
                            background: `url(${url5})`,
                            backgroundSize: 'contain',
                            backgroundRepeat: 'no-repeat'}}></div>
                        </Draggable>
                    {/* </div>

                    <div className="single-pic"> */}
                        <Draggable 
                        onStart={handleStart} 
                        onStop={handleStop}
                        grid={[25, 25]}>
                            <div className="handle1" style={{position: 'relative',
                            background: `url(${url8})`,
                            backgroundSize: 'contain',
                            backgroundRepeat: 'no-repeat'}}></div>
                        </Draggable>
                    {/* </div>

                // </div>

                <div className="pic-line"> */}
                    {/* 3rd line, 3 - 6 - 9 */}
                    {/* <div className="single-pic"> */}
                        <Draggable 
                        onStart={handleStart} 
                        onStop={handleStop}
                        grid={[25, 25]}>
                            <div className="handle1" style={{position: 'relative',
                            background: `url(${url3})`,
                            backgroundSize: 'contain',
                            backgroundRepeat: 'no-repeat'}}></div>
                        </Draggable>
                    {/* </div>

                    <div className="single=pic"> */}
